import React ,{Component} from "react"
import Form from "./Form"

export default class index extends Component {

	constructor(){
		super()
		this.state = {
			name:"Gaurav",
			age:21,
			lastName:"Baranawal"
		}
	}

	render(){
		return <div>
					Hi {this.state.name} and age {this.state.age}
					<Form lname={this.state.lastName}/>
				</div>
	}
}


